import "./style.css";

const Nav = ({ homePage, setHomePage }) => {
  const handleHome = () => {
    setHomePage(true);
  };

  return (
    <nav className={homePage !== false ? "App-navOff" : "App-nav"}>
      <div className="App-DivLogo">
        <p className="App-pOne">Nu</p>
        <p className="App-pTwo">Kenzie</p>
      </div>

      <div>
        <button onClick={() => handleHome()}>Inicio</button>
      </div>
    </nav>
  );
};
export default Nav;
